import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Header from "./Header";
import './App.css';

function App() {
  return (
  	<Router>
     <div className="app">
      <Switch> 
        <Route path="/checkout">
         <Header />
          <h1>checkout</h1>
        </Route>
         <Route path="/login">
          <h1>Login </h1>
         </Route>
         <Route path="/">
         <Header />
          <h1>HOME PAGE</h1>   
        </Route>
      </Switch>
     </div>
    </Router>
  );
}

export default App;
